window.bookSummaryJSON = "<p>First comes love, then comes mating, then comes the baby and some cupid training.</p> <p>Cupidville is overrun with new cupid recruits, and it’s up to me to train them in time for Valentine’s Day. Too bad I have four mates who keep insisting that it’s time for me to take a break. Juggling my role as the cupid boss, being a mate, and handling motherhood isn’t always easy, but it’s sure as hearts worth it. Let’s just hope I can get these cupid flunkies trained in time.</p> <p>Author’s note: This is a Heart Hassle novella just in time for Valentine’s Day. Audiobooks one to three in the Cupidity world must be listened to before this story. Intended for audiences 18 years and older.</p>"; 
